struct Solution;
use std::collections::HashMap;

impl Solution {
  pub fn is_anagram(s: String, t: String) -> bool {
    if s.len() != t.len() {
      return false;
    }
    let primes = HashMap::from([('a', 107), ('b' , 3), ('c' , 103), ('d' , 7), ('e' , 11), ('f' , 13), ('g' , 17), ('h' , 19), ('i' , 23), ('j' , 29), ('k' , 31), ('l' , 37), ('m' , 41), ('n' , 43), ('o' , 47), ('p' , 53), ('q' , 59), ('r' , 61), ('s' , 67), ('t' , 71), ('u' , 73), ('v' , 79), ('w' , 83), ('x' , 89), ('y' , 97), ('z' , 101)]);
    let mut s_sum:u64 = 1;
    let mut t_sum:u64 = 1;
    //let num: u128 = 1329227995784915872903807060280344575;
    for c in s.chars() {
      s_sum *= primes[&c];
      //println!("mut:{s_sum}");
      s_sum <<= 8;
      //println!("leftshift:{s_sum}");
      s_sum >>= 8;
      //println!("rightshift:{s_sum}");
      // if s_sum != 0 {
      //   println!("{}", primes[&c]);
      //   println!("{s_sum}");
      // }
      // else {
      //   println!("{}", primes[&c]);
      //   return false;
      // }
    }
    for c in t.chars() {
      t_sum *= primes[&c];
      t_sum <<= 8;
      t_sum >>= 8;
    }
    println!("{s_sum} {t_sum}");
    return s_sum == t_sum;
  }
}

fn main() {
  let mut a = std::u128::MAX;
  a <<= 4;
  a >>= 4;
  let b: u128 = 1329227995784915872903807060280344575;
  let c: u128 = b << 4;
  println!("{a}");
  println!("{:?}", format!("{a:b}"));
  println!("{:?}", format!("{b:b}"));
  println!("{:?}", format!("{c:b}"));

  let s = String::from("");
  let t = String::from("");

  println!("{}", Solution::is_anagram(s, t));

}